// lib/mapLayout.ts

// Interface para descrever um sub-path dentro de um distrito ou estado
interface GeoSubPath {
  d: string; // Os dados do path (o valor do atributo 'd')
  fill?: string; // Opcional: Cor de preenchimento padrão deste sub-path
  stroke?: string; // Opcional: Cor da borda padrão deste sub-path
  strokeWidth?: string; // Opcional: Espessura da borda padrão deste sub-path (camelCase para JSX)
  // Outros atributos SVG específicos deste path, se houverem
}

// Interface para descrever a informação de layout de uma forma geográfica (distrito ou estado)
// Cada forma é identificada por um ID e pode ser composta por um ou mais paths.
export interface GeoLayoutInfo {
  id: string; // O ID da forma (<path id="..."> ou <g id="...">)
  paths: GeoSubPath[]; // Array de sub-paths que compõem esta forma
}

